var ts = new THREE.Vector3(this.scale.x, this.scale.y, this.scale.z);
var os = new THREE.Vector3(this.scale.x*1.2, this.scale.y*1.2, this.scale.z*1.2);

//Click/Touch Start
function rayStart( event ) {
	console.log("start");
	this.material.color.set(0x000000);
}

//First Gaze/Mouse Over
function rayHoverStart( event ) {
	console.log("hoverStart");
	crossHairScaling(true);
	TweenMax.to(this.scale, 0.2, {x: os.x, y:os.y, z:os.z});	
}

//Gaze/Mouse Over
function rayHover( event ){
	console.log("hover");

}

//Mouse/Touch Down ( V1 Impossible )
function rayUpdate( event ) {
	console.log("update");
	this.material.color.set(randomColor());

}

//Gaze/Mouse/Touch End
function rayEnd( event ) {
	console.log("rayEnd");
	crossHairScaling(false);
	TweenMax.to(this.scale, 0.1, {x: ts.x, y:ts.y, z:ts.z});
	this.material.color.set(0xffffff);
}

